import React from "react";
import styled from "styled-components";
const Wrapper = styled.section`
  width: 100%;
  height: 335px;
  background-color: #47d99b;
  & > div {
    width: 993px;
    height: 100%;
    margin: 0 auto;
  }
`;
function Section2() {
  return (
    <Wrapper>
      <div></div>
    </Wrapper>
  );
}

export default Section2;
